function filtro(){
	$("#loading").show();
	$.ajax({
		url  : "credenciales_actions.php",
		data : $("#f_search").serialize(),
		type : "POST",
		success : function(response){
			$("#loading").hide();
			$("#tablaalu").html(response);
			aplica_accion();
		}
	});
	return false;
}
